import React from 'react';

const ProfessionalPicture= () => {

    return(
        <div className="ProfessionalPicture">
            <div className="ImageWrapper">
<img className="fit-cover" src={'https://wallpaperplay.com/walls/full/e/5/3/13586.jpg'}/>
            </div>

            <div className="nameContainer">
                <p className="name"> Connie Visser </p>
                <p className="profession"> Dietistenpraktijk Astrid Holweg </p>
            </div>

            <div className="blendContainer">

            </div>

            <div className="iconImageWrapper">
                <img src={require('../assets/icons/icons/color/dietist_kleur_1.svg')} className="pictureIcon"/>
            </div>



        </div>
    );

};

export default ProfessionalPicture;
